const addStructure = (arr) => {
  const dataTask = arr
    .map((obj) => {
      if (obj.priority === 1) {
        return {
          ...obj,
          priorityText: "Low",
          priorityColor: "colorLow",
        };
      } else if (obj.priority === 2) {
        return {
          ...obj,
          priorityText: "Medium",
          priorityColor: "colorMedium",
        };
      } else if (obj.priority === 3) {
        return {
          ...obj,
          priorityText: "High",
          priorityColor: "colorHigh",
        };
      }
    })
   
};

export default addStructure;
